      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\rWeird name, right? Strangest "cube" I''ve ever seen.\nThat there''s an artifact that was first discovered in Kalos and later researched in the Alola region which is ']}
      - !ruby/object:RPG::EventCommand {i: 0, c: 401, p: ['used to store the fragments of Zygarde, which are categorized as Cells or Cores.\nYou''re gonna want to store as much of them in the Zygarde Cube as possible if']}
