      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\rI bet you''d like to be able to just use its big boss form whenever you''d like, huh?\nYeah, I know that feeling. But unfortunately if Zygarde was in its Complete ']}
      - !ruby/object:RPG::EventCommand {i: 0, c: 401, p: [Forme ALL the time while traveling around with you then it wouldn't be able to act as the one who nullifies threats to the world's ecosystems.]}
      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\rSee, while Zygarde is having fun adventuring with you, another fragment of itself is on neighborhood watch duty at all times back in some boring old cave in the ']}
      - !ruby/object:RPG::EventCommand {i: 0, c: 401, p: [Kalos region.\nThat fragment is the one that decides how much of itself it needs to gather at once in order to deal with threats like that blockhead Taen.\nSo while]}
      - !ruby/object:RPG::EventCommand {i: 0, c: 401, p: ['Zygarde definitely doesn''t mind lending you its full strength every once in a while, it can''t really just go around leaving the ecosystem unprotected.']}
      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\rAnd so that brings us to the purpose of those cute little slime buddies that were all over the place during Operation Z.\nAt all times, Zygarde keeps track of things ']}
      - !ruby/object:RPG::EventCommand {i: 0, c: 401, p: [that are happening by splitting itself into those cells and scattering them all over the world. Don't ask me how many of them there are because even if I knew where]}
      - !ruby/object:RPG::EventCommand {i: 0, c: 401, p: ['all of them were, there''s no way I''d be able to count up all of the little critters myself.']}
      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\rBut on that note, since this region is finally seeing the first real peace since well before I was even born, I''d reckon that there''s less of a need for Zygarde to ']}
